import "./IERC721.sol";

contract NFTLoan {
    address  owner;
    struct NftLoasInfo {
        uint256 tokenId;
        uint loanTime;
        uint256 flag;            
    }

    IERC721 public nftContract;
    mapping (address => NftLoasInfo[]) public loans;
    mapping (address => uint256) public loansNumber;

constructor(address _owner) {
    owner = _owner;

}
